import { useState } from "react";
import LoginForm from "./LoginForm";
import User from "./User";


const LoginModal = ({isShow}) =>{

    const token = localStorage.getItem("token");
    const [render, setRender] = useState(true);
    const logout = () => {
        localStorage.setItem("token","");
        localStorage.setItem("userName","");
        setRender(!render);
    }

    return(
        <div id="login" className={`bg-white shadow-lg right-80 h-auto px-4 py-3 absolute ${isShow?'scale-100':'scale-0'} origin-top transition-all duration-500 w-64 z-10 overflow-auto scrollbar`}>
            <img src="data:image/png;base64," className="rounded-full block h-20 t-0 mx-auto mb-3" alt="" />
            {
                token?<User logout={logout}/>:<LoginForm />
            }
            

            <div className="text-xs text-gray-900">
                {token?'':(
                    <>
                    Don't have an account? 
                    <button type="button" className="text-blue-600">Sign up</button>
                    </>
                )}
            </div>
        </div>
    )
}
export default LoginModal;